  false,\n\t\"url\": null,\n\t\"notes\": \"This document is an assessment of alternatives
  to water management issues on Bowdoin National Wildlife Refuge.  Marsh productivity
  has been declining due to salts accumulating in low areas on the refuge, brought
  in by Beaver Creek it's floodplain that is on part of the refuge. By improving water
  quality on the refuge, it is hoped that marsh productivity can be restored and will
  support the refuge's highest priority objective, duck production. Management alternatives
  include: no action, natural rhythm, Lake Bowdoin Sump alternative, and disposal
  alternative.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
